    "clarence-cannon-national-wildlife-refuge-annual-narrative-report-calendar-year-1986",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Clarence
    Cannon NWR outlines Refuge accomplishments during the 1986 calendar year. The report
    begins with a summary of the year's highlights and weather conditions. Land acquisition
    is covered. The report includes a planning section which discusses management planning.
    Refuge administration is outlined; information about personnel, youth programs,
    manpower programs, funding, and safety is given. Habitat management is also covered;
    subjects include wetlands, forests, croplands, fire management, and pest control.
    The wildlife section of the report discusses endangered and threatened species,
    waterfowl, marsh birds and waterbirds, shorebirds, raptors, game mammals, fisheries
    resources, and disease control. The public uses of the Refuge described in this
    report include interpretive programs. The equipment and facilities section of the
    report provides information about rehabilitation, equipment replacement, and energy
    conservation.",nt"license_title": "License Not Specified",nt"extras":
